import React from "react";
import ReactBootstrap, {Nav, Button, Navbar, FormControl, Form} from 'react-bootstrap'

function Header() {
    return (
    <div>
        <header>
        <Navbar bg="#955F61" variant="dark">
    <Navbar.Brand href="#home">KhanaShana</Navbar.Brand>
    <Nav className="mr-auto">
      <Nav.Link className = "Menu" href="#home">Home</Nav.Link>
      <Nav.Link className = "Services" href="#features">Features</Nav.Link>
      <Nav.Link className = "AboutUs" href="#pricing">Pricing</Nav.Link>
    </Nav>
    <Form inline>
      <FormControl type="text" placeholder="Search" className="text" />
      <Button variant="outline-info">Search</Button>
    </Form>
  </Navbar>
        </header>
    </div>
    );
}

export default Header;
